import api from './api';

export const progressService = {
  async list() {
    const { data } = await api.get('/progress');
    return data;
  },

  async create(entry) {
    const { data } = await api.post('/progress', entry);
    return data;
  },

  async getById(id) {
    const { data } = await api.get(`/progress/${id}`);
    return data;
  },

  async update(id, entry) {
    const { data } = await api.put(`/progress/${id}`, entry);
    return data;
  },

  async remove(id) {
    const { data } = await api.delete(`/progress/${id}`);
    return data;
  }
};

export default progressService;
